import React from "react"; 
import "./Companias.css";
import trashBin from "../Assets/Imagenes/TrashBin.png";

const Companias = () => {
  return (
    <div className="compania-container">
      <div className="compania-left-side">
        <h2 className="compania-registro-text">COMPAÑIAS REGISTRADAS</h2>
        <div className="compania-category-list">
          <img src={trashBin} alt="Eliminar" className="compania-trash-icon" />
        </div>
      </div>
      <div className="compania-right-side">
        <div className="compania-input-group">
          <div className="compania-text">NOMBRE DE LA COMPAÑIA</div>
          <input type="text" id="category-name" className="compania-input-field" />
        </div>
    
        <button className="compania-register-button">REGISTRAR NUEVA COMPAÑIA</button>
        <button className="compania-edit-button">CONFIRMAR EDICION</button>
      </div>
    </div>
  );
};

export default Companias;
